import React from 'react';
import '../App.css';
import kumi from '../attachments/kumi kumi necklace.PNG';

function Product({name, description, price}) {
    return (
    <div className="product">
        <h3>{name}</h3>
        <h6>
            {description}
        </h6>
        <img src={kumi} />
        <p>
            {price}
        </p>

    </div>
    );
}

export default Product;
